import './App.css';
import { Switch, Route } from 'react-router-dom';
import home from './pages/home';

const App = () => {
  return (
    <Switch>
      <PublicRoute 
        exact
        path='/'
        component={home}
      />
    </Switch>
  );
}

export default App;
